import React from "react";
import { Link } from "react-router-dom";

const RouteTest = () => {
    return (
        <div>
            <Link to="/">home</Link>
            <br />
            <Link to="/diary">Dairy</Link>
            <br />
            <Link to="/new">New</Link>
            <br />
            <Link to="Edit">Edit</Link>
        </div>
    );
};

export default RouteTest;
